import React, { useState,useEffect } from "react";
import "../../css/navbar.css";
import Logo from "../../images/logo.png";
import Data from "../../data"; // Importing the patient data
import PatientCard from "./PatientCard";
import { useNavigate } from "react-router-dom";

export default function Navbar() {
  const navigate=useNavigate();
  const [text, setText] = useState("");
  const [searchResults, setSearchResults] = useState([]); // Store search results
  const [submittedResults, setSubmittedResults] = useState([]); // Store results after submit
  //clearing history after logging out
  useEffect(() => {
    window.history.replaceState(null, null, "/");
  }, []);

  // Handle input change & dynamic search
  const handleInputChange = (event) => {
    const searchQuery = event.target.value;
    setText(searchQuery);

    if (searchQuery.trim() === "") {
      setSearchResults([]); // Clear results when input is empty
      return;
    }

    const filteredResults = Data.filter((patient) =>
      patient.name.toLowerCase().includes(searchQuery.toLowerCase())
    );

    setSearchResults(filteredResults);
  };

  //handle log out
  const handelLogOut=()=>{
    navigate("/")
  }

  // Handle form submission
  const handleOnSubmit = (event) => {
    event.preventDefault(); // Prevent page reload

    if (text.trim() === "") {
      setSubmittedResults([]); // Clear results if input is empty
      return;
    }

    const filteredResults = Data.filter((patient) =>
      patient.name.toLowerCase().includes(text.toLowerCase())
    );

    const doctorName = "Dr. Smith";
    const initials = doctorName
      .split(" ")
      .map((n) => n[0])
      .join("");

    setSubmittedResults(filteredResults); // Store submitted search results
  };
  return (
    <div>
      <nav className="navbar">
        <a className="navbar-brand" href="/">
          <img src={Logo} alt="Logo" style={{ width: "80px" }} />
        </a>

        <form role="search" onSubmit={handleOnSubmit}>
          <input
            className="input-section"
            type="search"
            placeholder="Patient Name"
            aria-label="Search"
            value={text}
            onChange={handleInputChange}
          />
          <button type="submit" className="btn nav-btn btn-outline-success m-4">Submit</button>
        </form>
        {/* Avatar / Initials Dropdown */}
        <div className="dropdown">
          <div
            className="btn btn-secondary dropdown-toggle d-flex align-items-center justify-content-center"
            style={{
              width: "45px",
              height: "45px",
              borderRadius: "50%",
              fontWeight: "bold",
              fontSize: "18px",
              backgroundColor: "#007bff",
              color: "white",
            }}
            role="button"
            data-bs-toggle="dropdown"
            aria-expanded="false"
          >
            {initials}
          </div>
          <ul className="dropdown-menu dropdown-menu-end">
            <li>
              <button className="dropdown-item" onClick={handleLogOut}>
                Log out
              </button>
            </li>
          </ul>
        </div>
      </nav>

      {/* Display search results */}
      {text.trim() !== "" && (
  <div className="search-results">
    {searchResults.length > 0 ? (
      searchResults.map((patient, index) => (
        <PatientCard
          key={index}
          name={patient.name}
          contact={patient.contact}
          email={patient.email}
          gender={patient.gender}
        />
      ))
    ) : (
      <div className="mt-5 mx-5" style={{ color: "#5f6466" }}>
        <p>No Patient Found</p>
      </div>
    )}
  </div>
)}
    </div>
  );
}
